import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Segment
          style={{
            margin: "",
            backgroundColor: "black",
            padding: "20px 0 0 0",
            width: "100%",
            height: "38%",
          }}
        ></Segment>
      </Layout>
    );
  }
}

export default index;
